Since $x = 2 \cos t - \sin t$ and $y = 4 \sin t$,
\begin{align*}
ax^2 + bxy + cy^2 &= a (2 \cos t - \sin t)^2 + b (2 \cos t - \sin t)(4 \sin t) + c (4 \sin t)^2 \\
&= a (4 \cos^2 t - 4 \cos t \sin t + \sin^2 t) + b (8 \cos t \sin t - 4 \sin^2 t) + c (16 \sin^2 t) \\
&= 4a \cos^2 t + (-4a + 8b) \cos t \sin t + (a - 4b + 16c) \sin^2 t.
\end{align*}

To make this simplify to $1$, we set
\begin{align*}
4a &= 1, \\
-4a + 8b &= 0, \\
a - 4b + 16c &= 1.
\end{align*}

Solving this system, we find $(a,b,c) = \left(\frac{1}{4}, \frac{1}{4}, \frac{5}{64}\right)$.

question:
Find $x.$

[asy]
unitsize(0.7 cm);

pair A, B, C, D, O;

O = (0,0);
A = 4*dir(160);
B = 5*dir(160 + 180);
C = 8*dir(20);
D = 4*dir(20 + 180);

draw(A--B);
draw(C--D);
draw(A--C);
draw(B--D);

label("$4$", (A + O)/2, SW);
label("$10$", (C + O)/2, SE);
label("$4$", (D + O)/2, NW);
label("$5$", (B + O)/2, NE);
label("$8$", (B + D)/2, S);
label("$x$", (A + C)/2, N);
label("$A$", A, W);
label("$B$", B, E);
label("$C$", C, E);
label("$D$", D, W);
label("$O$", O, N);
[/asy]

solution:
Let $D = (l,0,0),$ $E = (0,m,0),$ and $F = (0,0,n).$  Then triangle $DEF$ is the medial triangle of triangle $ABC.$

[asy]
unitsize(0.5 cm);

pair A, B, C, D, E, F;

A = (2,5);
B = (0,0);
C = (9,0);
D = (B + C)/2;
E = (A + C)/2;
F = (A + B)/2;

draw(A--B--C--cycle);
draw(D--E--F--cycle);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
label("$F$", F, NW);
[/asy]

Hence, $EF = \frac{BC}{2},$ so
\[BC^2 = 4EF^2 = 4m^2 + 4n^2.\]Similarly, $AC^2 = 4l^2 + 4n^2,$ and $AB^2 = 4l^2 + 4m^2,$ so
\[\frac{AB^2 + AC^2 + BC^2}{l^2 + m^2 + n^2} = \frac{(4l^2 + 4m^2) + (4l^2 + 4n^2) + (4m^2 + 4n^2)}{l^2 + m^2 + n^2} = \frac{8l^2 + 8m^2 + 8n^2}{l^2 + m^2 + n^2} = \boxed{8}.\]

negative_solution:
Let $l,$ $m,$ and $n$ be real numbers, and let $A,$ $B,$ $C$ be points such that the midpoint of $\overline{BC}$ is $(l,0,0),$ the midpoint of $\overline{AC}$ is $(0,m,0),$ and the midpoint of $\overline{AB}$ is $(0,0,n).$ We want to find
\[\frac{AB^2 + AC^2 + BC^2}{l^2 + m^2 + n^2}.\]
By definition, the midpoint of $\overline{BC}$ is $(l,0,0),$ so the length of $\overline{BC}$ is $2l$. Similarly, the length of $\overline{AC}$ is $2m$, and the length of $\overline{AB}$ is $2n$. Let $D = (l,0,0),$ $E = (0,m,0),$ and $F = (0,0,n).$ Then triangle $DEF$ is the medial triangle of triangle $ABC$.

[asy]
unitsize(0.5 cm);

pair A, B, C, D, E, F;

A = (2,5);
B = (0,0);
C = (9,0);
D = (B + C)/2;
E = (A + C)/2;
F = (A + B)/2;

draw(A--B--C--cycle);
draw(D--E--F--cycle);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$D$", D, S);
label("$E$", E, NE);
label("$F$", F, NW);
[/asy]

Hence, $EF = \frac{BC}{2} = l$, so
\[BC^2 = l^2.\]Similarly, $AC^2 = m^2,$ and $AB^2 = n^2,$ so
\[\frac{AB^2 + AC^2 + BC^2}{l^2 + m^2 + n^2} = \frac{n^2 + m^2 + l^2}{n^2 + m^2 + l^2} = \boxed{1}.\]

solution:
Let $\theta = \angle DBA.$  Then $\angle CAB = \angle DBC = 2 \theta.$

[asy]
unitsize(3 cm);

pair A, B, C, D, O;

D = (0,0);
A = (1,0);
B = extension(D, D + dir(30), A, A + dir(45));
O = (B + D)/2;
C = 2*O - A;

draw(A--B--C--D--cycle);
draw(A--C);
draw(B--D);

label("$A$", A, S);
label("$B$", B, NE);
label("$C$", C, N);
label("$D$", D, SW);
label("$O$", O, NW);
label("$\theta$", B + (-0.5,-0.4));
label("$2 \theta$", B + (-0.4,-0.1));
label("$2 \theta$", A + (0.25,0.4));
[/asy]

Note that $\angle COB = \angle OAB + \angle OBA = 3 \theta,$ so by the Law of Sines on triangle $BCO,$
\[\frac{OC}{BC} = \frac{\sin 2 \theta}{\sin 3 \theta}.\]Also, by the Law of Sines on triangle $ABC,$
\[\frac{AC}{BC} = \frac{\sin 3 \theta}{\sin 2 \theta}.\]Since $AC = 2OC,$
\[\frac{\sin 3 \theta}{\sin 2 \theta} = \frac{2 \sin 2 \theta}{\sin 3 \theta},\]so $\sin^2 3 \theta = 2 \sin^2 2 \theta.$  Then
\[(3 \sin \theta - 4 \sin^3 \theta)^2 = 2 (2 \sin \theta \cos \theta)^2.\]Since $\theta$ is acute, $\sin \theta \neq 0.$  Thus, we can divide both sides by $\sin^2 \theta,$ to get
\[(3 - 4 \sin^2 \theta)^2 = 8 \cos^2 \theta.\]We can write this as
\[(4 \cos^2 \theta - 1)^2 = 8 \cos^2 \theta.\]Using the identity $\cos 2 \theta = 2 \cos^2 \theta - 1,$ we can also write this as
\[(2 \cos 2 \theta + 1)^2 = 4 + 4 \cos 2 \theta.\]This simplifies to
\[\cos^2 2 \theta = \frac{3}{4},\]so $\cos 2 \theta = \pm \frac{\sqrt{3}}{2}.$  If $\cos 2 \theta = -\frac{\sqrt{3}}{2},$ then $2 \theta = 150^\circ,$ and $\theta = 75^\circ,$ which is clearly too large.  So $\cos 2 \theta = \frac{\sqrt{3}}{2},$ which means $2 \theta = 30^\circ,$ and $\theta = 15^\circ.$

Then $\angle ACB = 180^\circ - 2 \theta - 3 \theta = 105^\circ$ and $\angle AOB = 180^\circ - 3 \theta = 135^\circ,$ so $r = \frac{105}{135} = \boxed{\frac{7}{9}}.$

