question:
A parallelogram is generated by the vectors $\begin{pmatrix} 2 \\ 1\\ 1 \end{pmatrix}$ and $\begin{pmatrix} 1 \\ -1 \\ - 1 \end{pmatrix}.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D;

A = (0,0);
B = (7,2);
C = (1,3);
D = B + C;

draw(A--B,Arrow(6));
draw(A--C,Arrow(6));
draw(B--D--C);
draw(B--C,dashed);
draw(A--D,dashed);
[/asy]

If $\theta$ is the angle between the diagonals, then find $\cos \theta.$

solution:
Suppose that vectors $\mathbf{a}$ and $\mathbf{b}$ generate the parallelogram.  Then the vectors corresponding to the diagonals are $\mathbf{a} + \mathbf{b}$ and $\mathbf{b} - \mathbf{a}.$

[asy]
unitsize(0.4 cm);

pair A, B, C, D, trans;

A = (0,0);
B = (7,2);
C = (1,3);
D = B + C;
trans = (10,0);

draw(B--D--C);
draw(A--B,Arrow(6));
draw(A--C,Arrow(6));
draw(A--D,Arrow(6));

label("$\mathbf{a}$", (A + B)/2, SE);
label("$\mathbf{b}$", (A + C)/2, W);
label("$\mathbf{a} + \mathbf{b}$", interp(A,D,0.7), NW, UnFill);

draw(shift(trans)*(B--D--C));
draw(shift(trans)*(A--B),Arrow(6));
draw(shift(trans)*(A--C),Arrow(6));
draw(shift(trans)*(B--C),Arrow(6));

label("$\mathbf{a}$", (A + B)/2 + trans, SE);
label("$\mathbf{b}$", (A + C)/2 + trans, W);
label("$\mathbf{b} - \mathbf{a}$", (B + C)/2 + trans, N);
[/asy]

Thus, the vectors corresponding to the diagonals are $\begin{pmatrix} 3 \\ 0 \\ 0 \end{pmatrix}$ and $\begin{pmatrix} 1 \\ 2 \\ 2 \end{pmatrix}.$  Then
\[\cos \theta = \frac{\begin{pmatrix} 3 \\ 0 \\ 0 \end{pmatrix} \cdot \begin{pmatrix} 1 \\ 2 \\ 2 \end{pmatrix}}{\left\| \begin{pmatrix} 3 \\ 0 \\ 0 \end{pmatrix} \right\| \left\| \begin{pmatrix} 1 \\ 2 \\ 2 \end{pmatrix} \right\|} = \frac{3}{3 \cdot 3} = \boxed{\frac{1}{3}}.\]

Let $\mathbf{v} = \begin{pmatrix} x \\ y \end{pmatrix},$ let $\mathbf{r}$ be the reflection of $\mathbf{v}$ over $\begin{pmatrix} 3 \\ 2 \end{pmatrix},$ and let $\mathbf{p}$ be the projection of $\mathbf{v}$ onto $\begin{pmatrix} 3 \\ 2 \end{pmatrix}.$

Note that $\mathbf{p}$ is the midpoint of $\mathbf{v}$ and $\mathbf{r}.$  Thus, we can use $\mathbf{p}$ to compute the reflection matrix.

[asy]
unitsize(1 cm);

pair D, P, R, V;

D = (3,2);
V = (1.5,2);
R = reflect((0,0),D)*(V);
P = (V + R)/2;

draw((-1,0)--(4,0));
draw((0,-1)--(0,3));
draw((0,0)--D,Arrow(6));
draw((0,0)--V,red,Arrow(6));
draw((0,0)--R,blue,Arrow(6));
draw((0,0)--P,green,Arrow(6));
draw(V--R,dashed);

label("$\mathbf{p}$", P, S);
label("$\mathbf{v}$", V, N);
label("$\mathbf{r}$", R, SE);
[/asy]

From the projection formula,
\begin{align*}
\mathbf{p} &= \operatorname{proj}_{\begin{pmatrix} 3 \\ 2 \end{pmatrix}} \begin{pmatrix} x \\ y \end{pmatrix} \\
&= \frac{\begin{pmatrix} x \\ y \end{pmatrix} \cdot \begin{pmatrix} 3 \\ 2 \end{pmatrix}}{\begin{pmatrix} 3 \\ 2 \end{pmatrix} \cdot \begin{pmatrix} 3 \\ 2 \end{pmatrix}} \begin{pmatrix} 3 \\ 2 \end{pmatrix} \\
&= \frac{3x + 2y}{13} \begin{pmatrix} 3 \\ 2 \end{pmatrix} \\
&= \begin{pmatrix} \frac{9x + 6y}{13} \\ \frac{6x + 4y}{13} \end{pmatrix}.
\end{align*}Since $\mathbf{p}$ is the midpoint of $\mathbf{v}$ and $\mathbf{r},$
\[\mathbf{p} = \frac{\mathbf{v} + \mathbf{r}}{2}.\]Then
\begin{align*}
\mathbf{r} &= 2 \mathbf{p} - \mathbf{v} \\
&= 2 \begin{pmatrix} \frac{9x + 6y}{13} \\ \frac{6x + 4y}{13} \end{pmatrix} - \begin{pmatrix} x \\ y \end{pmatrix} \\
&= \begin{pmatrix} \frac{5x + 12y}{13} \\ \frac{12x - 5y}{13} \end{pmatrix} \\
&= \begin{pmatrix} 5/13 & 12/13 \\ 12/13 & -5/13 \end{pmatrix} \begin{pmatrix} x \\ y \end{pmatrix}.
\end{align*}Thus, the matrix is $\boxed{\begin{pmatrix} 5/13 & 12/13 \\ 12/13 & -5/13 \end{pmatrix}}.$

question:
How many triangles are in the figure below? [asy]
draw((0,0)--(30,0)--(30,20)--(0,20)--cycle);
draw((15,0)--(15,20));
draw((0,0)--(15,20));
draw((15,0)--(0,20));
draw((15,0)--(30,20));
draw((30,0)--(15,20));
draw((0,10)--(30,10));
draw((7.5,0)--(7.5,20));
draw((22.5,0)--(22.5,20));
[/asy]

Thirty identical toothpicks were used to create the figure below. There are over 25 triangles in the figure. What is the fewest number of toothpicks that could be removed so that no triangles remain?

[asy]
draw((0,0)--(8,0), linewidth(1));
draw(2dir(60)--(2dir(60)+(6,0)), linewidth(1));
draw(4dir(60)--(4dir(60)+(4,0)), linewidth(1));
draw(6dir(60)--(6dir(60)+(2,0)), linewidth(1));

draw((0,0)--8dir(60),linewidth(1));
draw((2,0)--(6dir(60)+(2,0)),linewidth(1));
draw((4,0)--(4dir(60)+(4,0)),linewidth(1));
draw((6,0)--(2dir(60)+(6,0)),linewidth(1));

draw(2dir(60)--(2,0),linewidth(1));
draw(4dir(60)--(4,0),linewidth(1));
draw(6dir(60)--(6,0),linewidth(1));
draw(8dir(60)--(8,0),linewidth(1));
[/asy]

solution:
The point $(x,y)$ satisfies $x < y$ if and only if it belongs to the shaded triangle bounded by the lines $x=y$, $y=2$, and $x=0$, the area of which is 2.  The rectangle has area 6, so the probability in question is $\dfrac{2}{6} = \boxed{\dfrac{1}{3}}$.

[asy]
defaultpen(.7);
draw((-1,0)--(5,0),Arrow);
draw((0,-1)--(0,3),Arrow);
for (int i=1; i<4; ++i) {
draw((i,-0.1)--(i,0.1));
}
fill((0,0)--(0,2)--(2,2)--cycle,gray(0.7));
draw((-0.1,1)--(0.1,1));
draw((-.1,2)--(0,2));
draw((3,0)--(3,2)--(0,2),linewidth(1.0));
draw((-0.5,-0.5)--(2.8,2.8),dashed);
[/asy]

question:
A point $P$ is randomly placed in the interior of the right triangle below.  What is the probability that the area of triangle $PBC$ is less than half of the area of triangle $ABC$?  Express your answer as a common fraction. [asy]
size(7cm);
defaultpen(linewidth(0.7));
pair A=(0,5), B=(8,0), C=(0,0), P=(1.5,1.7);
draw(A--B--C--cycle);
draw(C--P--B);
label("$A$",A,NW);
label("$B$",B,E);
label("$C$",C,SW);
label("$P$",P,N);
draw((0,0.4)--(0.4,0.4)--(0.4,0));[/asy]

solution:
Let $h$ be the distance from $P$ to $CB$.  The area of triangle $ABC$ is $\frac{1}{2}(AC)(CB)$.  The area of triangle $PBC$ is $\frac{1}{2}(h)(CB)$.  Therefore, the area of triangle $PBC$ is less than one-half of the area of triangle $ABC$ if $h<AC/2$.  This happens if $P$ falls below the dashed line whose endpoints are the midpoints $D$ and $E$ of $\overline{AC}$ and $\overline{AB}$.  Triangle $ADE$ is similar to triangle $ACB$, so the ratio of the area of triangle $ADE$ to the area of triangle $ACB$ is $\left(\frac{AD}{AC}\right)^2=\frac{1}{4}$.  Therefore, the ratio of the area of trapezoid $DEBC$ to the area of triangle $ABC$ is $1-\dfrac{1}{4}=\boxed{\frac{3}{4}}$.

[asy]
size(7cm);
defaultpen(linewidth(0.7));
pair A=(0,5), B=(8,0), C=(0,0), P=(1.5,1.7);
draw(A--B--C--cycle);
draw((A+C)/2--(A+B)/2,dashed);
dot(P);
label("$A$",A,NW);
label("$B$",B,E);
label("$C$",C,SW);
label("$P$",P,E);
label("$D$",(A+C)/2,W);
label("$E$",(A+B)/2,NE);
draw((0,0.4)--(0.4,0.4)--(0.4,0));[/asy]
